import React, { Component } from 'react';
import { Jumbotron } from 'react-bootstrap';

class LandingPage extends Component {
  render() {
    return (
      <div>
          <Jumbotron>
              <h2>Hello</h2>
              <p>Welcome to my page</p>
          </Jumbotron>
    </div>
    );
  }
}

export default LandingPage;
